import logo from './logo.svg';
import me from './assets/jyp.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p className="intro">
        Allo! 만나서 반가워요!
      </p>
      <img src={me} className="profile" alt="logo" />

    </div>
  );
}

export default App;
